A '''class''' is a collection whose members either fall under a predicate or are classified by a rule. Hence, while a set can be [[Extensional and intensional definitions|extensionally]] defined only by its elements, a class has also an intensional dimension that unites its members. When the term 'class' is applied so that it includes those sets whose elements are intended to be collected without a common predicate or rule, the distinction can be indicated by calling such sets "improper class."  

[[Philosopher]]s sometimes distinguish classes from [[type (metaphysics)|types]] and [[natural kind|kinds]]. The ''class'' of human beings is discussed, as well as the ''type'' (or ''natural kind''), human being, or humanity. While both are typically treated as [[abstract object]]s and not different [[category of being|categories of being]], types not classes are usually treated as [[universal (metaphysics)|universals]]. Whether natural kinds ought to be considered universals is vexed; see [[natural kind]].

Types and kinds are discussed differently. [[Socrates]] is considered a [[Type-token distinction|''token'']] of a type (or an [[Instantiation principle|''instance'']] of the natural kind, human being) but a ''member'' of the class of human beings. He is a token (instance) not member of the type (kind), human beings. He is a member not type (or kind) of a class. The terminology is that types (or kinds) have tokens (or instances) while classes have members.

A class is conceptualized similarly to a set defined by its members.<ref>{{cite book|author=Antony Flew|author-link=Antony Flew|page=64|title=Dictionary of Philosophy}}</ref> The class is extensional. A set defined intensionally is a set of things that meet some requirement https://tr4200812.github.io/Android/ad-click-api/com.duckduckgo.adclick.api/index.html#1164838308%2FClasslikes%2F1598326845

